import styled from 'styled-components';

export const StyledInnerCard = styled.div`
    display: flex;
    flex-direction: column;
    border-radius: 8px;
    background-color: #c35252;
    width: ${(props) => props.width};
    max-width: ${(props) => props.maxwidth};
    height: ${(props) => props.height};
`
